import React from 'react';
import Sidebar from '../components/Sidebar/Sidebar';
import Board from '../components/Board/Board';
import './home.css';

const Home = () => {
  return (
    <div className="Home">
      <Sidebar className=".Home__board"/>
      <Board className=".Home__sidebar"/>
    </div>
  );
};

export default Home;
